import React from "react";
import Header from "./components/Header";
import Note from "./components/Note"
import Footer from "./components/Footer";

function createNote(note) {
    return (
        <Note 
        id={note.id}
        key={note.id}
        title={note.title}
        content={note.content}
        />
    );
}

function App() {
    return <div>
        <Header />
        <Note title="First Note" content="first Content" />
        <Note title="Second Note" content="Second Content" />
        <Note title= "Third Note" content= "Third Note"/>
        <Footer />
    </div>
}

export default App;
